import React from 'react';
import {Router, Route, Link, Switch} from 'react-router-dom';
import MatchesList from './MatchesList';
import PredictionCreate from './PredictionCreate';
import PastPredictions from './PastPredictions';
import history from '../../history';

const PredictionsContainer = ({match}) =>{
  const SubView = ({ match }) => {
    const TagName = match.params.sectionName;
    return(
      <div>
        <TagName />
      </div>
    )
  };

  return(
    <div className = "ui container">
      <div className="ui secondary pointing menu">
        <div className="left menu">
          <Link to={`${match.url}Matches`} className="item">
            Matches
          </Link>
          <Link to={`${match.url}/PastPredictions`} className="item">
            Past Predictions
          </Link>
        </div>
      </div>
      <Route exact path="/" component={MatchesList} />
      <Route path={`${match.url}/:sectionName`} component={SubView} />
    </div>
  );
};
export default PredictionsContainer;
